#InsertionSort.py

# Question: Sort a linked list using insertion sort.
# Question from: https://oj.leetcode.com/problems/insertion-sort-list/
# Author: DongDing 
# Date: 2014/06/23
# Time complexity: O(N*N)
# space complexity:  Î˜(1) 

# Definition for singly-linked list.
class ListNode:
    def __init__(self, x):
        self.val = x
        self.next = None
    def setbeforehead(self,x):
        node = ListNode(x)
        node.next = self
        return node
class Solution:
    # @param head, a ListNode
    # @return a ListNode
    def insertionSortList(self, head):
        insert = head
        while insert != None:
            temp = insert
            while temp.next != None:
                temp = temp.next
                if temp.val < insert.val:
                    register = temp.val
                    temp.val = insert.val
                    insert.val = register
                else:
                    pass
            temp_value = insert.val
            temp = insert
            insert = insert.next
            
            ## multiple duplicate number accelarater 
            
            while temp.next != None:
                temp = temp.next
                if temp.val == temp_value:
                    register = temp.val
                    temp.val = insert.val
                    insert.val = register
                    insert = insert.next
                else:
                    pass            
        return head
